import React from 'react';
import '../styles/components.css';

const Projects = () => {
    const projectList = [
        {
            title: 'Super Gramola',
            description: 'Una breve descripción del proyecto, destacando las características clave y tecnologías utilizadas.',
            link: 'https://github.com/Dmedina-coder/SuperGramola'
        },
        {
            title: 'Spotifice',
            description: 'Una aplicación que replica el funcionamiento básico de Spotify, permitiendo la gestión de renderizado y servidores de música de manera distribuida utilizarndo para ello Python y Flask en el backend y React en el frontend y ZeroC Ice para la comunicación entre servicios.',
            link: 'https://github.com/ssdd-classroom/2526-Dmedina-coder'
        },
        {
            title: 'GameKey Hunter 2.0',
            description: 'Un proyecto que consiste en una aplicación para comparar claves de videojuegos digitales de manera consultando diversas APIs.',
            link: 'https://github.com/Dmedina-coder/isi-gamekeyhunter2.0'
        }
    ];

    return (
        <section className="projects" id="projects">
            <h2>./Proyectos más relevantes</h2>
            <ul>
                {projectList.map((project, index) => (
                    <li key={index}>
                        <h3>{project.title}</h3>
                        <p>{project.description}</p>
                        <a href={project.link} target="_blank" rel="noopener noreferrer">Ver Proyecto</a>
                    </li>
                ))}
            </ul>
        </section>
    );
};

export default Projects;
